const Blog_Main = ({ blog }) => {
  return (
    <main className="grid gap-y-5 md:col-span-3">
      <div className="flex justify-between">
        <span>{blog.uploadDate}</span>
      </div>
    </main>
  );
};

export default Blog_Main;
